import "core-js/modules/es.array.push.js";
import axios from 'axios';
export default {
  name: 'AddAddress',
  props: ['registration_id'],
  // Certifique-se de que está recebendo o registration_id como prop
  data() {
    return {
      valid: true,
      address: {
        registration_id: this.registration_id,
        // Use o prop recebido
        type: '',
        cep: '',
        street: '',
        number: '',
        complement: '',
        neighborhood: '',
        state: '',
        city: ''
      },
      errorMessage: '',
      rules: {
        required: value => !!value || 'Campo obrigatório.'
      }
    };
  },
  methods: {
    submitAddress() {
      axios.post('/addresses', this.address).then(() => {
        this.$router.push({
          name: 'SomeOtherRoute'
        }); // Redireciona para outra rota após sucesso
      }).catch(error => {
        if (error.response) {
          this.errorMessage = error.response.data.message || 'Erro ao submeter os dados.';
        } else if (error.request) {
          this.errorMessage = 'Nenhuma resposta recebida do servidor.';
        } else {
          this.errorMessage = 'Erro ao configurar a requisição: ' + error.message;
        }
      });
    }
  }
};
